export default function TestTailwind() {
  return (
    <div className="bg-blue-500 text-white p-6 rounded-lg max-w-md mx-auto mt-10">
      <h1 className="text-3xl font-bold">Test Tailwind</h1>
      <p className="mt-4">Si ce bloc est bleu avec du texte blanc, Tailwind fonctionne !</p>
    </div>
  );
}
